import React from 'react'

function ProgramsCard(props) {
  return (
    
    <div className='program-card'>

        <img src={props.image}/>
        
        <div>{props.heading}</div>

        <div>{props.details}</div>

    
    
    </div>
  )
}

export default ProgramsCard
